function imageClick(e){e.preventDefault();let t=this.parentElement.parentElement;if(t.classList.contains("col-20")){let e=this.parentElement.pathname;this.src=e,t.classList.add("col-100"),t.classList.remove("col-20")}else t.classList.add("col-20"),t.classList.remove("col-100")}Array.from(document.getElementsByClassName("post-image")).forEach(function(e){e.onclick=imageClick});